import React from "react";
import { Line } from "react-chartjs-2";

const data = {
  labels: ["", "", "", "", "", ""],
  datasets: [
    {
      data: [12, 19, 3, 5, 2, 3],
      backgroundColor: [
        "#ecf0f1",
        "#ecf0f1",
        "#ecf0f1",
        "#ecf0f1",
        "#ecf0f1",
        "#ecf0f1",
      ],
      borderColor: [
        "#bdc3c7",
        "#bdc3c7",
        "#bdc3c7",
        "#bdc3c7",
        "#bdc3c7",
        "#bdc3c7",
      ],
      borderWidth: 1,
    },
  ],
};

const options = {
  scales: {
    yAxes: [
      {
        ticks: {
          beginAtZero: true,
        },
      },
    ],
  },
};

const VerticalBar = () => (
  <>
    <Line data={data} options={options} />
  </>
);

export default VerticalBar;
